import fetch from '../lib/fetch';

const generateToken = async (clientName) => {
    let res = null;

    try{
        let resp = await fetch.fetchPost('http://localhost:8080/api/auth/generate-jwt', {clientName});
        res = resp.data;
    } catch {

    }
    return res;
}

const funcs = {
    generateToken
}

export default funcs;
